import './styles.css';
import { connect } from 'react-redux';
import React, { Fragment } from 'react'
import * as selectors from '../../reducers'
import NewBaby from '../NewBaby';
import Baby from '../Baby';

const AppState = ({app}) => (
    <Fragment>
        {
            app ? (
                <NewBaby></NewBaby>
            ):(
                <Baby></Baby>
            )
        }
    </Fragment>
)

export default connect(
    (state) => ({
        app: selectors.getAppState(state)
    }),
    undefined
)(AppState)
